Owner_Owner_Image_1.query:
q = load "${App.Datasets.UX_Sample_Data_21_tp.FullyQualifiedName}";
q_A = filter q by 'Activity_Type' == "Call";
q_B = filter q by 'Activity_Type' == "Email";
result = group q by ('Opportunity', 'Account_Owner', 'Account_Owner_Image') full, q_A by ('Opportunity', 'Account_Owner', 'Account_Owner_Image') full, q_B by ('Opportunity', 'Account_Owner', 'Account_Owner_Image');
result = foreach result generate coalesce(q_A.'Opportunity', q_B.'Opportunity', q.'Opportunity') as 'Opportunity', coalesce(q_A.'Account_Owner', q_B.'Account_Owner', q.'Account_Owner') as 'Account_Owner', coalesce(q_A.'Account_Owner_Image', q_B.'Account_Owner_Image', q.'Account_Owner_Image') as 'Account_Owner_Image', avg(q_A.'Activity_Count') as 'A', avg(q_B.'Activity_Count') as 'B', avg(q.'Age') as 'C', sum(q.'Amount') as 'D', count(q) as 'E';
result = group result by ('Opportunity', 'Account_Owner', 'Account_Owner_Image');
result = foreach result generate 'Opportunity', 'Account_Owner', 'Account_Owner_Image', first(A) as 'A', first(B) as 'B', first(C) as 'C', first(D) as 'D', first(E) as 'E', rank() over([..] partition by 'Opportunity' order by sum(D) desc) as 'Rank';
result = filter result by 'Rank' >= 1 && 'Rank' <= 3;
result = order result by ('Opportunity' asc, 'Account_Owner' asc, 'Rank' desc);
result = limit result 2000;
